.currency-notes-modal {
  top: 39px!important;
}

.curren-symbol {
  height: 112px;
  display: flex;
  background-color: #fff;
  border-radius: 12px;
  box-shadow: 0px 3px 6px 0px rgba(0, 0, 0, 0.04);
  margin-bottom: 30px;
  .symbol-total, .symbol-info {
    flex: 1;
    display: flex;
    flex-direction: column;
    justify-content: center;
    padding-left: 24px;
  }
  .symbol-name {
    font-size: 14px;
    color: #16161F;
    font-weight: 600;
    margin-bottom: 5px;
  }
  .symbol-info {
    border-left: 1px solid #EEEEEF;
    .tit {
      font-size: 14px;
      color: #A7B4CB;
      line-height: 22px;
    }
    .vla {
      font-size: 14px;
      line-height: 20px;
      font-weight: 600;
      color: #16161F;
      &.u-4-cl {
        color: #eb4d5c;
      }
      &.u-1-cl {
        color: #13b887;
      }
    }
  }
}
